** Analysis:

The exception occurs on Z/OS, apparently because of code page/character
encoding problems.  That is, 'createHeaderInputStream' creates a print
writer which uses the system default encoding, but 'writeHeader' marks the
new body of the in-memory generated document as using UTF-8.  On Z/OS, the
system default encoding [System.getProperty("file.encoding")] returns "Cp1047".

** Recommended Code Change:

The code change below -- to create the print writer using an output stream
writer, and forcing the character encoding to "UTF-8" -- resolved the problem.
See below for additional notes, as there problem is also fixed by changing
the encoding which is set in the header text.

    com.ibm.wtp.internal.emf.xml.util.DOMUtilities
    org.eclipse.wst.common.internal.emf.utilities.DOMUtilities

Initial code:

    private static InputStream createHeaderInputStream(String doctype, String publicId, String systemId, boolean includeDummy) {
        ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
        PrintWriter writer = new PrintWriter(outputStream);
        writeHeader(writer, doctype, publicId, systemId);
        if (includeDummy)
            addDummyEntity(writer);
        writer.flush();
        writer.close();
        return new java.io.ByteArrayInputStream(outputStream.toByteArray());
    }

Updated code:

    private static InputStream createHeaderInputStream(String doctype, String publicId, String systemId, boolean includeDummy) {
        ByteArrayOutputStream outputStream = new ByteArrayOutputStream();

        // The prior code (which is still in the catch block), uses
        // the system default encoding [System.getProperty("file.encoding")];
        // on Z/OS this is Cp1047.  The combination of "UTF-8" in the header
        // and "Cp1047" in the writer create an unusable input stream.

        PrintWriter writer; 

        try {
            OutputStreamWriter outputWriter = new OutputStreamWriter(outputStream, "UTF-8");
            // throws UnsupportedEncodingException

            writer = new PrintWriter(outputWriter);

        } catch ( UnsupportedEncodingException e ) {
            writer = new PrintWriter(outputStream); // Should never get here (earlier code)
        }

        writeHeader(writer, doctype, publicId, systemId);
        if (includeDummy)
            addDummyEntity(writer);
        writer.flush();
        writer.close();

        byte[] bytes = outputStream.toByteArray();
        return new ByteArrayInputStream(bytes);
    }

Alternatively, or in addition, 'writeHeader' could be modified to accept a
encoding, which would be suitably passed in from 'createHeaderInputStream':

    protected static void writeHeader(PrintWriter writer, String doctype, String publicId, String systemId, String encoding) {
        writer.write("<?xml version=\""); //$NON-NLS-1$
        writer.write("1.0"); //$NON-NLS-1$
        writer.write("\" encoding=\""); //$NON-NLS-1$
        writer.write(encoding); //$NON-NLS-1$
        writer.write("\"?>"); //$NON-NLS-1$
        writer.println();
    ...

