Actually, I don't believe we need to disable the Find occurrences action.  The problem seems to be both Find Occurrences & JSP Java validation lock the workspace.  In reality, the find occurrences does not need to lock the entire workspace since it is only finding occurrences in 1 specific file.  And all it really needs to do is update markers in that 1 specific file.  

So the fix is in the find occurrences action, rather than trying to perform it's action using the workspace root scheduling rule (thus locking the workspace) use the marker rule for the specific file.

The fix is to replace:
ResourcesPlugin.getWorkspace().run(runnable, null);
with:
ResourcesPlugin.getWorkspace().run(runnable, ResourcesPlugin.getWorkspace().getRuleFactory().markerRule(fFile), IWorkspace.AVOID_UPDATE, null);

