Fix is a 1-line fix in 2 classes -org.eclipse.wst.sse.ui.internal.search.BasicSearchQuery -org.eclipse.wst.sse.ui.internal.search.OccurrencesSearchQuery
*BasicSearchQuery Replace: ResourcesPlugin.getWorkspace().run(runnable, null); With: ResourcesPlugin.getWorkspace().run(runnable, ResourcesPlugin.getWorkspace().getRuleFactory().markerRule(fFile), IWorkspace.AVOID_UPDATE, null);
* Replace: ResourcesPlugin.getWorkspace().run(findRegions, null); With: ResourcesPlugin.getWorkspace().run(findRegions, ResourcesPlugin.getWorkspace().getRuleFactory().markerRule(getFile()), IWorkspace.AVOID_UPDATE, null);

