org.eclipse.wst.sse.ui.patch

Cleaned up code a little so that the scheduling rule is separated out into a local variable.  So fix now looks like this:
ISchedulingRule markerRule = ResourcesPlugin.getWorkspace().getRuleFactory().markerRule(fFile);
ResourcesPlugin.getWorkspace().run(runnable, markerRule, IWorkspace.AVOID_UPDATE, null); 

I should also clarify the old method call, ResourcesPlugin.getWorkspace().run(runnable, null) 
was the equivalent to:
ResourcesPlugin.getWorkspace().run(runnable, workspace.getRoot(), IWorkspace.AVOID_UPDATE, null);

All the fix does is use the markerRule instead of the workspace.getRoot rule.  Everything else is the same.

