We have extended the Intro with content that uses the current page ID for part of its generated content (we call them brochures).

However, when we click through these pages then click the Back/Forward buttons, the dynamic content uses the wrong page ID to load part of its dynamic content, though the proper page displays.

This is likely to occur in high visibility in our products.

SOLUTION:
The fix appears quite easy. You simply need to switch two lines in BrowserIntroPartImplementation.java in the navigateForward() and navigateBackward() methods.

//CURRENT
success = generateDynamicContentForPage(page);
getModel().setCurrentPageId(page.getId(), false);

Currently it generates the dynamic content before it even sets the page ID, which screws up our page because the page requires the page ID.

//SUGGESTED CHANGE
getModel().setCurrentPageId(page.getId(), false);
success = generateDynamicContentForPage(page);

Here it sets the pageID for the page that is being loaded, then it loads the dynamic content.

We've tested this change and it appears to have no adverse effects.

