*Problem Statement:

Am seeing a StringIndexOutOfBoundsException in DirectoryLoadStrategyImpl.makeRelative:

[9/18/06 15:12:03:281 EDT] 0000000a ApplicationMg E   WSVR0100W: An         
error occurred initializing, can1                                           
java.lang.StringIndexOutOfBoundsException: String index out of range: -1    
        at java.lang.String.substring(String.java(Compiled Code))           
        at java.lang.String.substring(String.java(Compiled Code))           
        at                                                                  
com.ibm.etools.j2ee.commonarchivecore.strategy.DirectoryLoadStrategyImpl    
.makeRelative(DirectoryLoadStrat                                            
egyImpl.java:202)                                                           

The exception occurs when the two parameters to makeRelative are the same,
for example:

    aStrategy.makeRelative("/was/app/EnterpriseApps/can1.ear",
                           "/was/app/EnterpriseApps/can1.ear");

*Problem Analysis:

The exception occurs because a non-valid integer value is used as an
argument to String.substring:

    private String makeRelative(String fileName, String root) {
        if (fileName == null || root == null)
            return null;
        String name = null;
        for (; root.endsWith("/"); root = ArchiveUtil.truncateIgnoreCase(root, "/")); //$NON-NLS-1$ //$NON-NLS-2$
        name = replaceSeparators(fileName);
        if (name.startsWith(root))
            name = name.substring(root.length() + 1);  // **** EXCEPTION HERE
        else
            name = null;
        return name;
    }

When the file name and root are the same, the result is a call to:

    name.substring(name.length() + 1);

which will always fail with an exception.

Note that the conditions under which two equal values are parameters to
makeRelative may be the result of a non-valid application.  However, even
in this case, the code should not fail with the exception.

*Suggested Code Change:

In the CORONA code base, the problem is seen in the class:

com.ibm.etools.j2ee.commonarchivecore.strategy.DirectoryLoadStrategyImpl

In the WTP code base, the problem is seen in the class:

org.eclipse.jst.j2ee.commonarchivecore.internal.strategy.DirectoryLoadStrategyImpl

The code has been updated with several changes.

First, the use of truncateIgnoreCase is unnecessary, as the "/"
parameter is stable across cases.

Second, the final increment to the root length suggests that the
code is attempting to remove a separating slash character in
addition to the root text.  This fails when the root is a prefix
to the file path, but is either the entire file path, or is not
followed by a slash in the file path.  A second code change was
made to ensure that exactly one slash was left on the root (and
adding a slash if there was not already one).  This allowed the
'startsWith' and 'substring' calls to use the same prefix text.

private String makeRelative(String fileName, String root)
{
    if ( (fileName == null) || (root == null) )
        return null;

    int offset = root.length();

    while ( (offset > 0) && root.charAt(offset - 1) == '/' )
        offset--;

    if ( offset < root.length() ) {
        offset++;

        if ( offset < root.length() )
            root = root.substring(0, offset);
    } else {
        root += '/';
    }

    String name = replaceSeparators(fileName);

    if ( name.startsWith(root) )
        name = name.substring( root.length() );
    else
        name = null;

    return name;
}

